import React from 'react';
import useFetch from './useFetch';
import './App.css';

function App() {
  const { mensaje, object, error, loading } = useFetch("http://localhost:8092/api/showAll");
  if (loading) return <p>Loading...</p>;
  if (error) return <div className="error">{error}</div>;
  if (mensaje) return <div className="error">{mensaje}</div>;

  return (
    <div className="app-container">
      {object && Array.isArray(object) && (
        object.map(profile => (
          <div key={profile.id} className="profile-card">
            <p className="profile-name">{profile.nombre} {profile.apellidos}</p>
            <p>Curso: {profile.curso}</p>
            <p>AÃ±o de Ingreso: {profile.anoIngreso}</p>
            <p>Nota Media: {profile.notaMedia}</p>
          </div>
        ))
      )}
    </div>
  );

}




export default App;
